  state = {
    name: [
      {
        firstUser: 'BR'
      }
    ]
  }

  render() {

    return (
      <div className="App">
        <h1>First React Assignment</h1>
        <Components username='Bishal R' newName='this.state.name[0].firstUser' />
      </div>
    );
  }
}

export default App;
